def form_to_dict(str_form):
    str_form = str_form.replace(" ", "")
    print(str_form)
    str_data = str_form.replace("\t", "':'")
    list_str_data = str_data.split("\n")
    final_str_date = ""
    for sub_str_data in list_str_data:
        if not sub_str_data:
            continue
        sub_str_data = "'" + sub_str_data + "',"
        final_str_date += "\t" + sub_str_data + "\n"
    final_str_date = "{\n" + final_str_date[0:-2] + "\n}"
    try:
        eval(final_str_date)
        print(final_str_date)
        return final_str_date
    except Exception:
        return 'source 格式错误'


def form_to_dict_new(str_form):
    list_a = []
    list_b = []
    list_str_data = str_form.split("\n")
    for sub_str_data in list_str_data:
        list_c = sub_str_data.split("\t")
        if len(list_c) < 2:
            continue
        list_a.append(list_c[0])
        list_b.append(list_c[1])
    dict_aaa = dict(zip(list_a, list_b))
    str_aaa = str(dict_aaa)
    loads = yaml.load(str_aaa.replace(":", ": "))
    result = json.dumps(loads, indent=4, sort_keys=False, ensure_ascii=False)
    # result = result.replace("\r", "")
    print(result)



